import './projects.scss';

function Projects() {
  return (
    <div className="Projects">
      <div className="ProjectBox">
        <h2>Projects</h2>

        {/* Annota by The Tech4Good Lab */}
        <img src="../../../assets/Projects/Annota.png" alt="Annota"/>
        <h3>Annota</h3>
        <h5>UCSC, The Tech4Good Lab</h5>
      </div>
    </div>
  )
}

export default Projects
